        params: {query: term},
        headers: {
            Authorization: 'Client-ID whZNGu3kJMUVyitgzDwyXljnCiZXaBVvCSJnoF13yjI'
        }
    }).then((response) => {
        console.log(response);
    });
}

    render() {
        return (
